import './card.css';

const Compte =({name,lastname,id,onRouteChange,number,rating,email})=>{
	
  return (
   <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'> 
     <img alt='robots' src={`https://robohash.org/${id}?2000*200`} className='img_user' style={{width:'50 %', height:'160px'}} />
       <div> 
     <h2> {name} {lastname}</h2> 
     <p className='ml6 underline'>   3.5/5</p>
     <p>Numero : +212 {number}</p>
     <p>Sexe : sexe </p>
     <p>Créé le :<p className='b'> 11/02/2020</p></p>
       </div>
     

   </div>

  	)


}

export default Compte;
